import React from 'react';
import {Button,ButtonGroup,ButtonToolbar } from 'reactstrap';

function Nav() {
  return (
    <div>
      <ButtonToolbar>
        <ButtonGroup style={{height:"88px",width:"1292px",fontSize:"200%"}}>
          <Button color="warning"> Stage1 </Button>
          <Button color="warning"> Stage2 </Button>
          <Button color="warning"> Stage3 </Button>
          <Button color="warning"> Stage4 </Button>
          <Button color="warning"> Stage5 </Button>
        </ButtonGroup>
      </ButtonToolbar>
    </div>
  );
}

export default Nav;
